-- ----------------------------
-- Table structure for t_maruken_trans
-- ----------------------------
DROP TABLE IF EXISTS `t_maruken_trans`;
CREATE TABLE `t_maruken_trans` (
`id`  varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL ,
`受注日`  date NULL DEFAULT NULL ,
`店舗コード`  smallint(6) NOT NULL ,
`店舗名漢字`  varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL ,
`伝票番号`  int(11) NOT NULL ,
`キャンセル`  varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT 'no' ,
`キャンセル時刻`  datetime NULL DEFAULT NULL ,
`ジャンル`  tinyint(4) NULL DEFAULT NULL ,
`品名漢字`  varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL ,
`規格名漢字`  varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL ,
`発注数量`  int(11) NULL DEFAULT NULL ,
`口数`  int(11) NULL DEFAULT NULL ,
`重量`  int(11) NULL DEFAULT NULL ,
`単位`  varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL ,
`実際配送担当`  varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL ,
`県別`  varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL ,
`配送担当受信`  tinyint(1) NULL DEFAULT 0 ,
`配送担当受信時刻`  datetime NULL DEFAULT NULL ,
`専務受信`  tinyint(1) NULL DEFAULT 0 ,
`専務受信時刻`  datetime NULL DEFAULT NULL ,
`納品指示`  varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL ,
`備考`  varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL ,
PRIMARY KEY (`id`),
INDEX `店舗コード` (`店舗コード`) USING BTREE ,
INDEX `伝票番号` (`伝票番号`) USING BTREE ,
INDEX `店番＋伝番` (`店舗コード`, `伝票番号`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_unicode_ci

;

