`id`  int(11) NOT NULL AUTO_INCREMENT ,
`日付`  date NOT NULL ,
`区分`  varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL ,
`自社コード`  int(11) NOT NULL ,
