-- ----------------------------
-- View structure for v_all_shop_results
-- ----------------------------
DROP VIEW IF EXISTS `v_all_shop_results`;
CREATE ALGORITHM=UNDEFINED DEFINER=`god`@`%` SQL SECURITY DEFINER VIEW `v_all_shop_results` AS select `Template`.`t_shoplist`.`配送担当` AS `配送担当`,`Template`.`t_shoplist`.`県別` AS `県別`,`Template`.`t_shoplist`.`県内エリア` AS `県内エリア`,`Template`.`t_shoplist`.`店番` AS `店番`,`Template`.`t_shoplist`.`店名` AS `店名`,`Template`.`t_orderdata`.`品名漢字` AS `品名漢字`,`Template`.`t_weeks`.`週目` AS `週目`,`Template`.`t_orderstate`.`口数` AS `口数`,`Template`.`t_orderstate`.`キャンセル` AS `キャンセル`,`Template`.`t_orderdata`.`原価金額(税抜)` AS `原価金額(税抜)` from (((((`t_shoplist` left join `t_orderdata` on((`Template`.`t_orderdata`.`店舗コード` = `Template`.`t_shoplist`.`店番`))) left join `t_itemlist` on(((`Template`.`t_itemlist`.`商品名` = `Template`.`t_orderdata`.`品名漢字`) and (`Template`.`t_itemlist`.`配送担当` = `Template`.`t_shoplist`.`配送担当`)))) left join `t_orderstate` on((`Template`.`t_orderstate`.`id受注データ` = `Template`.`t_orderdata`.`id受注データ`))) left join `t_weeks` on((`Template`.`t_orderstate`.`通年週目` = `Template`.`t_weeks`.`ID`))) left join `t_genre` on((`Template`.`t_itemlist`.`ジャンル` = `Template`.`t_genre`.`idジャンル`))) where ((isnull(`Template`.`t_orderstate`.`キャンセル`) and (`Template`.`t_genre`.`idジャンル` = 1)) or ((`Template`.`t_orderstate`.`キャンセル` <> 'yes') and (`Template`.`t_genre`.`idジャンル` = 1))) order by `Template`.`t_shoplist`.`配送担当`,`Template`.`t_shoplist`.`県別`,`Template`.`t_shoplist`.`県内エリア` desc,`Template`.`t_shoplist`.`店番` ;

-- ----------------------------
-- View structure for v_fukuoka_shop_results
-- ----------------------------
DROP VIEW IF EXISTS `v_fukuoka_shop_results`;
CREATE ALGORITHM=UNDEFINED DEFINER=`god`@`%` SQL SECURITY DEFINER VIEW `v_fukuoka_shop_results` AS select `Template`.`t_shoplist`.`配送担当` AS `配送担当`,`Template`.`t_shoplist`.`県別` AS `県別`,`Template`.`t_shoplist`.`県内エリア` AS `県内エリア`,`Template`.`t_shoplist`.`店番` AS `店番`,`Template`.`t_shoplist`.`店名` AS `店名`,`Template`.`t_orderdata`.`品名漢字` AS `品名漢字`,`Template`.`t_weeks`.`週目` AS `週目`,`Template`.`t_orderstate`.`口数` AS `口数` from (((((`t_shoplist` left join `t_orderdata` on((`Template`.`t_orderdata`.`店舗コード` = `Template`.`t_shoplist`.`店番`))) left join `t_itemlist` on(((`Template`.`t_itemlist`.`商品名` = `Template`.`t_orderdata`.`品名漢字`) and (`Template`.`t_itemlist`.`配送担当` = `Template`.`t_shoplist`.`配送担当`)))) left join `t_orderstate` on((`Template`.`t_orderstate`.`id受注データ` = `Template`.`t_orderdata`.`id受注データ`))) left join `t_weeks` on((`Template`.`t_orderstate`.`通年週目` = `Template`.`t_weeks`.`ID`))) join `t_genre` on((`Template`.`t_itemlist`.`ジャンル` = `Template`.`t_genre`.`idジャンル`))) where (((`Template`.`t_shoplist`.`配送担当` = '丸健') and (`Template`.`t_shoplist`.`県別` = '福岡') and (`Template`.`t_orderstate`.`キャンセル` <> 'yes') and (`Template`.`t_genre`.`idジャンル` = 1)) or ((`Template`.`t_shoplist`.`配送担当` = '丸健') and (`Template`.`t_shoplist`.`県別` = '福岡') and isnull(`Template`.`t_orderstate`.`キャンセル`) and (`Template`.`t_genre`.`idジャンル` = 1))) order by `Template`.`t_shoplist`.`配送担当`,`Template`.`t_shoplist`.`県別`,`Template`.`t_shoplist`.`県内エリア` desc,`Template`.`t_shoplist`.`店番` ;

