CREATE ALGORITHM=UNDEFINED DEFINER=`god`@`%` SQL SECURITY DEFINER VIEW `v_orderlist` AS select `Template`.`t_orderstate`.`出荷日` AS `出荷日`,`Template`.`t_orderstate`.`納品日` AS `納品日`,`Template`.`t_orderdata`.`受注日` AS `受注日`,`Template`.`t_shoplist`.`配送担当` AS `配送担当`,`Template`.`t_shoplist`.`県別` AS `県別`,`Template`.`t_orderdata`.`店舗コード` AS `店舗コード`,`Template`.`t_shoplist`.`店名` AS `店名`,`Template`.`t_orderdata`.`品名漢字` AS `品名漢字`,`Template`.`t_orderstate`.`口数` AS `口数`,`Template`.`t_orderdata`.`発注数量` AS `発注数量`,`Template`.`t_orderdata`.`伝票番号` AS `伝票番号`,`Template`.`t_orderdata`.`原単価(税抜)` AS `原単価(税抜)`,`Template`.`t_orderdata`.`原価金額(税抜)` AS `原価金額(税抜)`,`Template`.`t_orderstate`.`受領` AS `受領`,`Template`.`t_orderstate`.`キャンセル` AS `キャンセル`,`Template`.`t_weeks`.`週目` AS `週目`,`Template`.`t_genre`.`ジャンル名` AS `ジャンル名`,`Template`.`t_orderdata`.`規格名漢字` AS `規格`,`Template`.`t_itemlist`.`自社コード` AS `自社コード` from (((((`t_orderdata` join `t_orderstate` on((`Template`.`t_orderstate`.`id受注データ` = `Template`.`t_orderdata`.`id受注データ`))) join `t_shoplist` on((`Template`.`t_orderdata`.`店舗コード` = `Template`.`t_shoplist`.`店番`))) join `t_weeks` on((`Template`.`t_orderstate`.`通年週目` = `Template`.`t_weeks`.`ID`))) join `t_itemlist` on(((`Template`.`t_orderdata`.`ＪＡＮコード` = `Template`.`t_itemlist`.`JANコード`) and (`Template`.`t_shoplist`.`配送担当` = `Template`.`t_itemlist`.`配送担当`)))) join `t_genre` on((`Template`.`t_itemlist`.`ジャンル` = `Template`.`t_genre`.`idジャンル`))) order by `Template`.`t_orderdata`.`受注日` ;

